                    "// src/tests/ui-test\r\n// index.js\r\n\r\nimport React, { QuickImports as q } from '../../ui/imports/index';\r\n\r\nimport Box, { boxAttributes as bx } from '../../ui/components/layouts/Box';\r\nimport BoxTester from './LayoutTesters/BoxTester-01';\r\nimport InputTextTester from './InputTesters/InputTextTester-01';\r\nimport ButtonTester from './ActorsTesters/ButtonTester';\r\nimport ToastTester from './ToastsTesters/ToastTester';\r\nimport StateMgrTest from './StateMgmntTesters/StateMgrTest';\r\nimport THM from '../../themes/index';\r\nimport { useState } from 'react';\r\n\r\nconst TesterApp = () => {\r\n  let d = {\r\n    testBox: false,\r\n    testInputText: false,\r\n    testButton: true,\r\n    testToast: true,\r\n\r\n    themes: {\r\n      dark01: false,\r\n      light01: true,\r\n    },\r\n  };\r\n  d = q.uiData(d);\r\n  let cmp = {\r\n    BoxTester,\r\n    InputTextTester,\r\n    ButtonTester,\r\n    ToastTester,\r\n  };\r\n  let ui = {\r\n    controls: {\r\n      /** @type {CSSStyleDeclaration} */\r\n      styles: {\r\n        height: '60px',\r\n        width: '280px',\r\n      },\r\n    },\r\n    themeCtrls: {\r\n      styles: {\r\n        height: '30px',\r\n        width: '100%',\r\n      },\r\n      click: ({ target }) => {\r\n        THM.currentTheme =\r\n          THM.currentTheme.name == 'dark01' ? 'light01' : 'dark01';\r\n      },\r\n    },\r\n  };\r\n\r\n  console.log({ rendering: 'TesterApp' });\r\n\r\n  return (\r\n    <>\r\n      <div>\r\n        <h4>Font Samples</h4>\r\n        {[\r\n          \"'Exo 2', sans-serif\",\r\n          \"'Nunito Sans', sans-serif\",\r\n          \"'Poppins', sans-serif\",\r\n          \"'Titillium Web', sans-serif\",\r\n          \"'Ubuntu', sans-serif\",\r\n          \"'Ubuntu Condensed', sans-serif\",\r\n        ].map((f) => {\r\n          return (\r\n            <div\r\n              style={{ fontFamily: f, fontSize: '12px' }}\r\n            >{`font-family: ${f};`}</div>\r\n          );\r\n        })}\r\n      </div>\r\n      <div>\r\n        <Box\r\n          orientation={bx.orientation.hRM}\r\n          width={ui.themeCtrls.styles.width}\r\n        >\r\n          <div>\r\n            Theme :{' '}\r\n            <span onClick={ui.themeCtrls.click}>{THM.currentTheme.icon}</span>\r\n          </div>\r\n        </Box>\r\n        <Box\r\n          c-nm=\"controls\"\r\n          height={ui.controls.styles.height}\r\n          width={ui.controls.styles.width}\r\n          orientation={bx.orientation.hLM}\r\n        >\r\n          {Object.keys(d).map((k) => {\r\n            if (k.startsWith('test')) {\r\n              return (\r\n                <>\r\n                  <input\r\n                    type=\"checkbox\"\r\n                    checked={d[k]}\r\n                    onChange={({ target }) => (d[k] = target.checked)}\r\n                  ></input>{' '}\r\n                  {k.replace('test', '')}\r\n                  <span>{' | '}</span>\r\n                </>\r\n              );\r\n            }\r\n          })}\r\n        </Box>\r\n        {Object.keys(d).map((k) => {\r\n          if (d[k] == true) {\r\n            let ccKey = `${k.replace('test', '')}Tester`;\r\n            let CC = cmp[ccKey];\r\n            return (\r\n              <>\r\n                <h4>{ccKey}</h4>\r\n                <CC />\r\n              </>\r\n            );\r\n          }\r\n        })}\r\n        {/* <InputTextTester /> */}\r\n      </div>\r\n    </>\r\n  );\r\n};\r\n\r\nexport default TesterApp;\r\n"
